import React from "react";

function App() {
  const time = new Date().toLocaleTimeString();

  const update = () => {
    return time;
  };

  return (
    <div className="container">
      <h1>{time}</h1>
      <button onClick={update}>Get Time</button>
    </div>
  );
}

export default App;
